KMtijU79K95W/f7XT3MxSZ1Ko9DlVtqhHU8/wAsfKeRfDHKeB1X8zcDn/dS/9k=\",\"mime\":\"image/jpeg\",\"copyright\":{\"license\":\"U\"},\"width\":829,\"height\":1000}},\"library\":\"H5P.Image 1.1\",\"metadata\":{\"contentType\":\"Imagem\",\"license\":\"U\",\"title\":\"Sem t√≠tulo Imagem\",\"authors\":[],\"changes\":[]},\"subContentId\":\"375f9a39-34d9-4b71-b950-de7d4d78acfd\"}},\"chapters\":[{\"params\":{\"content\":[{\"useSeparator\":\"auto\"}]},\"library\":\"H5P.Column 1.16\",\"subContentId\":\"b915454c-0317-44c0-81fa-147b7de43a1c\",\"metadata\":{\"contentType\":\"Coluna (Column)\",\"license\":\"U\",\"title\":\"Sem t√≠tulo Coluna (Column)\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Sem t√≠tulo Coluna (Column)\"}},{\"params\":{\"content\":[{\"content\":{\"params\":{\"text\":\"<p><span><span><span><span><span>A Aventura do Ar no Corpo Humano</span></span></span></span></span></p>\\n\\n<p><span><span><span><span><span>Era uma vez um Ar chamado Oxig√©nio, um oxig√©nio curioso que adorava viajar. Um dia, ¬†decidiu fazer uma grande aventura: entrar num corpo humano!</span></span></span></span></span></p>\\n\\n<p><span><span><span><span><span>Assim que o nariz se abriu com uma respira√ß√£o profunda, o Oxig√©nio entrou a voar:</span></span></span></span></span></p>\\n\\n<p><span><span><span><span><span>‚Äì \\\"Uau! Isto √© quentinho e h√∫mido. Parece uma gruta!\\\",¬†disse o  Oxig√©nio enquanto passava pela cavidade nasal.</span></span></span></span></span></p>\\n\\n<p><span><span><span><span><span>Logo a seguir, ¬†desceu pela faringe e chegou √† laringe, onde ouviu uma voz:</span></span></span></span></span></p>\\n\\n<p><span><span><span><span><span>‚Äì \\\"Bem-vindo! Eu sou a Laringe. Aqui fazemos os sons que ajudam a falar!\\\"</span></span></span></span></span></p>\\n\\n<p><span><span><span><span><span>O Oxig√©nio, continuou a sua viagem pela traqueia, um tubo longo como um escorrega.</span></span></span></span></span></p>\\n\\n<p><span><span><span><span><span>‚Äì \\\"Uhuuuu!\\\" ‚Äì gritou o  Oxig√©nio enquanto descia a alta velocidade.</span></span></span></span></span></p>\\n\\n<p><span><span><span><span><span>A traqueia dividiu-se em dois caminhos, a que  chamamos br√¥nquios. O Oxig√©nio escolheu o da esquerda e entrou num dos pulm√µes. L√° dentro, viu muitos bronqu√≠olos, como se fossem ruas de uma cidade muito organizada.</span></span></span></span></span></p>\\n\\n<p><span><span><span><span><span>No final de cada rua havia umas bolhinhas m√°gicas, a que chamamos alv√©olos.</span></span></span></span></span></p>\\n\\n<p><span><span><span><span><span>‚Äì \\\"√â aqui que deixo o meu presente!\\\", disse  o Oxig√©nio.</span></span></span></span></span></p>\\n\\n<p><span><span><span><span><span>¬†Entrou num alv√©olo e encontrou o Sr¬∫.¬†Sangue ¬†que exclamou:</span></span></span></span></span></p>\\n\\n<p><span><span><span><span><span>‚Äì \\\"Estava √† tua espera, Oxig√©nio! Vem comigo, vamos levar energia ao orpo todo!\\\"</span></span></span></span></span></p>\\n\\n<p><span><span><span><span><span>O Oxig√©nio  ficou muito feliz por ajudar. Mas antes de ir embora, viu o seu amigo CO‚ÇÇ (di√≥xido de carbono) a chegar, cansado de tanto trabalhar.</span></span></span></span></span></p>\\n\\n<p><span><span><span><span><span>‚Äì \\\"Agora √© a minha vez de sair!\\\" ‚Äì disse CO‚ÇÇ.</span></span></span></span></span></p>\\n\\n<p><span><span><span><span><span>CO‚ÇÇ fez o caminho de volta at√© √† boca e... foi expirado!</span></span></span></span></span></p>\\n\\n<p><span><span><span><span><span>O Oxig√©nio, por sua vez, viajou com o sangue para dar energia a todas as partes do corpo.</span></span></span></span></span></p>\\n\\n<p><span><span><span><span><span>E assim, todos os dias, milh√µes de Arzinhos como o Oxig√©nio vivem aventuras incr√≠veis dentro de n√≥s!</span></span></span></span></span></p>\\n\\n<p><span><span><span><span><span>Fim.</span></span></span></span></span></p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\
